import React from 'react';
import { View, Text, SafeAreaView } from 'react-native';

const Editstories = () => {
    return (
        <SafeAreaView style={{ flex: 1 }}>
            <View style={{ flex: 1, padding: 16 }}>
               <Text> Edit screens forms will comes here</Text>
            </View>
        </SafeAreaView>
    );
};

export default Editstories;
